let poseDetection;
let video;
let videoWidth, videoHeight;

let sketchGuiState = {
  showVideo: true,
  showSideVideo: true,
  numberOfSections: 5,
  showSectionBorders: true,
  sectionBorderWidth: 1,
  sectionBorderColor: '#000000',
  overallOpacity: 1,
  keypoints: {
    showPoint: true,
